Movie Info:Bombay Talkies is a 2013 Indian anthology film consisting of four short films, directed by Anurag Kashyap, Dibakar Banerjee, Zoya Akhtar and Karan Johar. The film released on May 3, 2013, coinciding with and celebrating the centenary year of Indian cinema and the beginning of a new era in modern cinema. It was screened at the 2013 Cannes Film Festival on May 17, 2013.


